import React from 'react'
import { SemaforoButton } from './SemaforoButton'

export const SemaforList = (props) => {

  const cells = props.buttonValues.map((value,index)=>{
      return(
          <SemaforoButton
                key= { index }
                value = { value }
          />
      )
  })
  return (
    <div>
        {cells}
    </div>
  )
}
